import { createAsyncThunk } from "@reduxjs/toolkit";


const BASE_URL = {
  all_newss: "https://dummyjson.com/newss"
};

export const getAllnewssThunk = createAsyncThunk(
  "newsSlice/getAllnewssThunk",
  async function ({ limit }) {
    try {
      const response = await fetch(
        BASE_URL.all_newss + "?limit=" + limit
      );

      const data = await response.json();

      return data;
    } catch (error) {}
  }
);
